import {produce} from 'immer'
export const InitialState={

 category:[
    {id:1,name:"משחקי חוץ"},
    {id:2,name:"משחקי קופסא"},
    {id:3,name:"משחקים לילדות"}
]
}

export const datareducerc=produce((state,action)=>{
    switch(action.type){
        
        default:
            break;
    }
},InitialState)
